import React from "react";

export function PostList (){
    const posts = [
        {
            title: "title1",
            description:"description1",
        },
        {
            title: "title2",
            description:"description2",
        },
        {
            title: "title3",
            description:"description3",
        },
    ];

    return(
        <section>
            {posts.map((post)=>(
                <Post postTitle={post.title} description={post.description} />
            ))}
        </section>
    )
};
